userrights-groups-help:
Бұл қатысушы кіретін топтарды реттей аласыз:
* Құсбелгі қойылған өріс қатысушының бұл топқа кіретінің көрсетеді;
* Құсбелгісі жоқ өріс қатысушының бұл топқа кірмейтінін көрсетеді;
* Жұлдызша (*) топ қосқаннан кейін, оны алып тастай алмайтыныңызды көрсетеді, немесе керісінше;
* Нөмір белгісі (#) бұл топтың мүшелігінің аяқталу мерзімін тек кейінге қалдыр алатыныңызды көрсетеді. Оны ертерек етіп қоя алмайсыз.

uploadtext:
Файл жүктеу үшін төмендегі пішінді қолданыңыз.
Бұрын жүктелген файлдарды іздеу үшін [[Special:FileList|жүктелген файлдар тізіміне]] өтіңіз. Сонымен қатар жүктеулер мен қайта жүктеулер [[Special:Log/upload|жүктеу журналына]] тіркеледі. Жоюлар [[Special:Log/delete|жою журналына]] тіркеледі.

Бетке файл қосу үшін төмендегі сілтеме пішіндерінің бірін қолданыңыз:
* Файлдың толық нұсқасын қолдану үшін <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:Файл.jpg]]</nowiki></code></strong>;
* Сол жақтағы өрісте астында «Жазу» деген мәтіні бар, ені 200 пиксель файлдың бейнелеуін қолдану үшін <strong><code><nowiki>[[</nowiki>{{ns:file}} <nowiki>:Файл.png|200px|thumb|left|Жазу]]</nowiki></code></strong>;
* Файлды көрсетпей, оған тікелей сілтеме қалдыру үшін <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:Файл.ogg]]</nowiki></code></strong>.

